window.bookSummaryJSON = "This adventure story has everything you could want: the good guy, some bad guys, the girl, sword fighting, revenge, romance, of course a happy ending, and rodents of unusual size. Join Westley the plucky farm boy, Buttercup the beautiful young maiden, Inigo Montoya the driven, embittered swordsman, and many other strange and unusual characters in this swashbuckling tale of good-natured silliness. It is read by Rob Reiner, who directed the motion picture based on this classic tale."; 
